  return (
    <div className="add-task" >
        <h1 className="add-title" >Adicionar nova tarefa:</h1>
      <form>
          <input className="input-text" type="text" placeholder="Descrição" />
          <input className="input-text"type="text" placeholder="Status" />
          <input className="input-text"type="text" placeholder="Prioridade" />

      </form>

    </div>
  );
}

export default AdicionaTask;
